import React, { useState } from 'react';
import './App.css';

function App() {

  const [num1, opr, num2] = useState('');

  return (
    <div className="App">
      <header className="App-header">
        <div>
          Get Inputs
        </div>
        <div>
          <input value={num1} />
          <input value={opr} />
          <input value={num2} />
        </div>
        <div>
          Rendered
        </div>
        <div>
          <b>{num1}{opr}{num2} </b>
        </div>

      </header>
    </div>
  );
}

export default App;
